// SPDX-License-Identifier:MIT
pragma solidity 0.8.13;

import "@openzeppelin-upgradeable/contracts/token/ERC1155/ERC1155Upgradeable.sol";

contract Game is ERC1155Upgradeable{
    struct Client{
        address addr;
        string UserName;
        uint256 ID;
        uint256 TokenOwned;
        mapping (string => uint256) TokentoID;
    }

    uint256 internal currentIDCount;
    uint256 internal currentClientCount;
    mapping (string => uint256) internal nameToID;
    mapping (address => mapping(string => uint256)) clientToToken;
    mapping (address => Client) internal addrToClient;
    mapping (uint256 => Client) internal clientIDtoClient;


    function initialize() initializer public {
        __ERC1155_init("");
     }

    function registerAsClient(address _addr, uint256 _id, string memory _username) public payable{
        //require(msg.value<1, "Not Enough balance!");
        // register new user after reg fees
        Client storage tmp = addrToClient[_addr];
        tmp.addr = _addr;
        tmp.ID = _id;
        tmp.UserName = _username;
        tmp.TokenOwned = 0;
    }

    function mintClass(address owner_account,string memory name ,uint256 amount) public returns (uint256) {
        nameToID[name] = currentIDCount;
        currentIDCount = currentIDCount + 1;

        _mint(owner_account, nameToID[name], amount, "");

        return nameToID[name];
    }

    function tranfer(address from, address to, string memory name, uint256 amount) public{
        require(balanceOf(from, nameToID[name])>=amount, "Not enough balance");
        _safeTransferFrom(from, to, nameToID[name], amount, "");
    }

    function getClientCount() public view returns(uint256){
        return currentClientCount;
    }

    function getTokenID(string memory _name) public view returns(uint256){
        return nameToID[_name];
    }
}
